import { Route, Routes } from "react-router-dom";
import './app.css'
import axios from 'axios';
import LoginPage from "./pages/LoginPage";

axios.defaults.baseURL = "http://127.0.0.1:4000";

function App() {


  return (

    <Routes>

      <Route path="/login" element={<LoginPage />} />

    </Routes>

  );
}

export default App;
